import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Cart from './Cart';
import PrivacyPolicy from './Privacy'


function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<PrivacyPolicy/>} />

      </Routes>
    </Router>
  );
}

export default App;
